export declare const MaxTst = "\nload Max.asm;\nset %0 16548, set %1 12944;\n\nrepeat 14 {\n   tick, tock;\n}\n";
export declare const MaxAsm = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/6/max/Max.asm\n\n// Computes R2 = max(R0, R1)  (R0,R1,R2 refer to RAM[0],RAM[1],RAM[2])\n// Usage: Before executing, put two values in R0 and R1.\n\n  // D = R0 - R1\n  @R0\n  D=M\n  @R1\n  D=D-M\n  // If (D > 0) goto ITSR0\n  @ITSR0\n  D;JGT\n  // Its R1\n  @R1\n  D=M\n  @OUTPUT_D\n  0;JMP\n(ITSR0)\n  @R0\n  D=M\n(OUTPUT_D)\n  @R2\n  M=D\n(END)\n  @END\n  0;JMP\n";
